    false,nt"url": null,nt"notes": "The Brownfields/Voluntary Cleanup Program
    (BVCP) provides property buyers, sellers, developers, bankers, development agencies,
    local government and other voluntary parties with technical assistance and oversight
    for the investigation and remediation of contaminated properties, in return for
    a Certificate of Completion, to bring them back into productive use. Many of these
    properties are not eligible for regulatory oversight from other programs within
    the Department of Natural Resources. Thus, the BVCP is oftentimes the only means
    for these properties to receive a Certificate of Completion. Enrolled projects may
    be eligible for financial assistance in the form of state and federal tax credits
    to help offset the cost of cleanup. There are fifty BVCP sites known as "Hidden
    Treasures", which are a selection of BVCP success stories that were examined to
    measure the economic and environmental impact of cleanup. Sources of information
    on the Hidden Treasures project included: the Missouri Department of Economic Development,
    the Environmental Protection Agency, local government Web sites, online business
    journals, newspaper articles, property owners' Web sites, site visits and interviews
    with property developers.",nt"license_title": null,nt"extras": [{ntt"key":
